import { PipelineToolbar } from './toolbar';
import { PipelineUI } from './ui';
import { SubmitButton } from './submit';

function App() {
  return (
    <div style={{ 
      height: '100%', 
      display: 'flex', 
      flexDirection: 'column',
      backgroundColor: '#f9fafb' 
    }}>
      {/* Header */}
      <header style={{ 
        flexShrink: 0,
        backgroundColor: 'white', 
        borderBottom: '1px solid #e5e7eb',
        padding: '12px 16px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between'
      }}>
        <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
          <h1 style={{ 
            fontSize: '18px', 
            fontWeight: 600, 
            color: '#111827',
            margin: 0
          }}>Pipeline Builder</h1>
          <span style={{ 
            fontSize: '12px', 
            color: '#6b7280',
            backgroundColor: '#f3f4f6',
            padding: '4px 8px',
            borderRadius: '4px'
          }}>
            v0.0.1
          </span>
        </div>
        <SubmitButton />
      </header>

      {/* Toolbar */}
      <PipelineToolbar />

      {/* Canvas */}
      <PipelineUI />
    </div>
  );
}

export default App;
